        "import pandas as pd\n",
        "import numpy as np\n",
        "import matplotlib.pyplot as plt\n",
        "import seaborn as sns\n",
        "%matplotlib inline\n",
        "\n",
        "df = pd.read_csv(\"AmesHousing.csv\")\n",
        "df.head()\n",
        "df.info()\n",
        "df.describe()\n",
        "print(f\"Satır: {df.shape[0]}, Sütun: {df.shape[1]}\")\n",
        "\n",
        "missing = df.isnull().sum()\n",
        "missing = missing[missing > 0].sort_values(ascending=False)\n",
        "\n",
        "plt.figure(figsize=(12,6))\n",
        "sns.barplot(x=missing.index, y=missing.values)\n",
        "plt.xticks(rotation=90)\n",
        "plt.title(\"eksik veri sayısı\")\n",
        "plt.show()\n",
        "\n",
        "numerical = df.select_dtypes(include=[np.number])\n",
        "categorical = df.select_dtypes(include=[\"object\"])\n",
        "print(\"sayısal sütunlar:\" , numerical.columns.tolist())\n",
        "print(\"katogorik sütunlar:\" , categorical.columns.tolist())\n",
        "\n",
        "corr = numerical.corr()\n",
        "top_features = corr[\"SalePrice\"].abs().sort_values(ascending=False)[1:11]\n",
        "\n",
        "plt.figure(figsize=(10,8))\n",
        "sns.heatmap(df[top_features.index].corr(), annot=True, cmap=\"coolwarm\")\n",
        "plt.title(\"En İlgili Özellikler Korelasyonu\")\n",
        "plt.show()\n",
        "\n",
        "plt.figure(figsize=(12,10))\n",
        "corr = numerical.corr()\n",
        "sns.heatmap(corr, annot=True, fmt=\".2f\", cmap=\"coolwarm\")\n",
        "plt.title(\"Korelasyon Matrisi\")\n",
        "plt.show()\n",
        "\n",
        "for col in categorical.columns:\n",
        "    print(f\"{col} sütunundaki en sık değerler:\\n\")\n",
        "    print(df[col].value_counts().head(5))\n",
        "    print(\"-\"*40)\n",
        "\n",
        "sns.histplot(df[\"SalePrice\"], bins=50, kde=True)\n",
        "plt.title(\"Ev Satış Fiyatı Dağılımı\")\n",
        "plt.xlabel(\"Satış Fiyatı\")\n",
        "plt.ylabel(\"Frekans\")\n",
        "plt.show()\n",
        "\n",
        "plt.figure(figsize=(12,6))\n",
        "sns.boxplot(x=\"Neighborhood\", y=\"SalePrice\", data=df)\n",
        "plt.xticks(rotation=45)\n",
        "plt.title(\"Mahallelere Göre Satış Fiyatları\")\n",
        "plt.show()\n",
        "\n",
        "neighborhood_avg = df.groupby(\"Neighborhood\")[\"SalePrice\"].mean().sort_values()\n",
        "plt.figure(figsize=(12,6))\n",
        "sns.barplot(x=neighborhood_avg.values, y=neighborhood_avg.index, palette=\"coolwarm\")\n",
        "plt.title(\"Mahallelere Göre Ortalama Satış Fiyatı\")\n",
        "plt.xlabel(\"Ortalama Fiyat\")\n",
        "plt.ylabel(\"Mahalle\")\n",
        "plt.show()\n",
